import React, { useRef, useState } from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import { Autoplay } from "swiper";
import 'swiper/css';
import 'swiper/css/pagination';
import TourData from "./tourdata";

import './Tourhome.css'

const Tourhome = () => {
    return (
        <>
          

                    <Swiper
                        spaceBetween={30}
                        centeredSlides={true}
                        autoplay={{
                            delay: 2500,
                            disableOnInteraction: false,
                        }}
                       
                        modules={[Autoplay]}
                        className="mySwiper"
                    >
                        <SwiperSlide><img src={TourData[0].Image1} alt="image" /></SwiperSlide>
                        <SwiperSlide><img src={TourData[0].Image2} alt="" /></SwiperSlide>

                       
                    </Swiper>
                  
                 
              
        </>
    )
}

export default Tourhome
